import Button from '@mui/material/Button';
import './App.css';


function App() {
  return (
    <header>
      <div>
        <div className="div-left">
          <ul>
              <li><Button variant="text">Text</Button></li>
              <li>MAIN</li>
              <li>SEARCH</li>
              <li>SITE1</li>
              <li>SITE2</li>
              <li>SITE3</li>
              <li>SITE4</li>
              <li>SITE5</li>
          </ul>
        </div>
        <div className="div-right">
          <h1>Lora IoT Management System</h1>
        </div>
      </div>
    </header>
  );
}

export default App;
